pub fn get_hive_root_grammar_id() -> GrammarId {
    GrammarId(1421)
}
pub fn get_hive_root_grammar_table() -> RootGrammar {
    RootGrammar {
        grammar_id: get_hive_root_grammar_id(),
        tables: &HIVE_TABLES,
    }
}
pub fn get_hive_root_grammar() -> RootGrammar {
    get_hive_root_grammar_table()
}
